import React, { Component } from 'react';
import './App.css';

function App() {
  return (
    <div>
      <div className="logo">
        <h1>navid</h1>
      </div>
      <ul>
                    <li><a to="/">home</a></li>
                    <li><a to="/bout">about</a></li>
                    <li><a to="/blog">blog</a></li>
                    <li><a to="/contact">contact</a></li>
                    <li><a to="login">login / singup </a></li>
                    <li><a className="close">x</a></li>
                </ul>
    </div>
  );
}

export default App;
